INSERT INTO `artikel_def` (`id_artikel`, `nama_penulis`, `tanggal_penulisan`, `judul`, `gambar`, `isi`, `sumber`) VALUES
('ART1', 'Admin', '2020-12-02', '5 PENYAKIT KULIT PADA KUCING BESERTA GEJALANYA', , 'Dari beberapa binatang yang kita kenal, Kucing merupakan salah satu hewan peliharaan yang digemarin pada masyarakat sekarang ini. Namun untuk menjaga kucing peliharaan agar memiliki kesehatan yang baik, pemelihara kucing harus lebih memperhatikan makanan dan perawatan kucing tersebut jika tidak kucing akan mudah terserang penyakit. Penyakit kulit adalah jenis penyakit yang sering menginfeksi hewan peliharaan khususnya kucing. Kucing yang terinfeksi penyakit kulit, terkadang tampak baik-baik saja dan tidak terganggu sehingga pemilik kucing tidak mengambil serius tentang kesehatan kulit kucing peliharaannya. Namun akan berakibat fatal jika dibiarkan secara terus-menerus, karena dapat menyebabkan kematian bagi kucing peliharaannya. \r\n\r\nPemilik kucing terkadang baru menyadari saat kucing peliharaannya mengalami perubahan yang signifikan seperti kerontokan sampai kebotakan, kulit kemerahan bahkan terdapat luka, berbau dan lain sebagainya. Di mana saat kucing terkena penyakit kulit, dokter hewan diharapkan dapat membantu dalam mengobati dan mencegah penyakit kulit tersebut agar tidak bertambah parah. Namun, banyak pemilik kucing tidak mencari perawatan hewan untuk kucing peliharaan mereka, pemilik kucing bahkan tidak punya waktu untuk membawa hewan peliharaan bertemu dokter hewan mereka karena jadwal yang padat. \r\n\r\nDikutip dari Jurnal Pilar Nusa Mandiri Vol.XII, No. 1 Maret 2016, berikut ini beberapa gelaja dan penyakit kulit pada kucing yang mungkin dialami oleh kucing anda.\r\n1.	Ringworm\r\nPenyakit Ringworm atau infeksi jamur kulit, biasanya diderita oleh kucing yang ditandai dengan beberapa gelaja. Gelaja tersebut antara lain, \r\na.	Kucing cenderung menggaruk-garuk badan berlebihan \r\nb.	Kulit terlihat kemerahan\r\nc.	Bulu rontok berlebihan \r\nd.	Umumnya tubuh kucing merasa gatal \r\ne.	Terdapat kerak di daerah tubuhya \r\nf.	Terdapat bintik-bintik botak \r\ng.	Kulit terlihat kering/bersisik \r\nh.	Terdapat luka melingkar pada kepala, telinga, dan lengan depan \r\ni.	Bulu menjadi rontok dipingiran luka yang melingkar \r\nj.	Bulu kucing terlihat patah-patah dan berketombe\r\nJika kucing anda memiliki beberapa gejala diatas, bisa disimpulkan bahwa kucing anda bisa saja menderita penyakit Ringworm. Cara yang bisa anda lakukan untuk menyembuhkan penyakit tersebut yang masih berskala ringan, adalah dengan memandikan kucing menggunakan shampoo yang mengandung bahan ketokenazole seminggu sekali, lalu diamkan 15 menit sebelum dibilas, keringkan sempurna. Namun jika penyakit tersebut tidak dapat disembuhkan, anda sebaiknya membawa kucing kesayangan anda kepada dokter hewan agar mendapat obat dan penanganan yang tepat.\r\n\r\n2.	Sporotrichosis\r\nPenyakit Sporotrichosis merupakan suatu infeksi kulit yang disebabkan oleh jamur Sporothrix schenckii. Jamur jenis ini sering ditemukan pada duri bunga mawar, jerami, sphagnum moss (spesies lumut atau gambut yang umumnya digunakan untuk media tanaman hias), ranting, dan tanah. Penyakit ini dapat diderita oleh kucing yang memiliki gejala sebagai berikut.\r\na.	Kulit kucing bernanah yang mengeluarkan bau\r\nb.	Terdapat luka berbentuk benjolan\r\nc.	Pembengkakan pada daerah tubuh\r\nd.	Kucing mengalami demam\r\ne.	Kehilangan nafsu makan\r\nf.	Terdapat infeksi di bagian tubuhnya (terutama sekali pada hidung dan muka), kaki dan ekor.\r\nHal yang harus anda lakukan ketika kucing anda mengalami gelaja diatas adalah mandikan kucing dengan shampoo mengandung bahan ketokenazole seminggu sekali, lalu diamkan 15 menit sebelum dibilas, keringkan sempurna. Jika gejala berlanjut, sebaiknya tetap konsultasi kepada dokter hewan agar diberikan resep obat yang tepat.\r\n\r\n3.	Stuild Tail\r\nStud tail (disebut juga sebagai hiperplasia pada kelenjar buntut atau ekor) adalah suatu kondisi ketika ekor kucing jantan memiliki kelenjar keringat (minyak) yang aktif pada bagian atas ekor. Beberapa gejala yang dialami kucing penderita penyakit ini adalah sebagai berikut.\r\na.	Terdapat coklat seperti lilin dipangkal ekor\r\nb.	Bulu terlihat berminyak\r\nc.	Bulu menjadi kusut\r\nd.	Ekor rambut yang rontok\r\ne.	Mengeluarkan bau tak sedap\r\nBeberapa alternatif untuk penanganan gelaja ringan adalah Secara teratur, mandikan hewan dengan menggunakan shampoo khusus yang dapat menghilangkan minyak berlebih pada ekor. Elain itu, untuk kucing jantan dapat di kebiri agar tubuh kucing dapat memproduksi kelenjar minyak dengan sendirinya\r\n\r\n4.	Scabies\r\nPenyakit scabies merupakan penyakit yang dialami karena timbulnya rasa gatal pada kulit akibat terdapatnya tungau yang menggali ke dalam kulit. Tungau ini disebut Sarcoptes scabiei. Adanya tungau tersebut menyebabkan rasa gatal yang hebat pada area di sekitar galian tersebut. Beberapa gelaja penyakit ini pada kucing adalah sebagai berikut.\r\na.	Kucing menggaruk-garuk badan berlebihan\r\nb.	Kulit terlihat kemerahan\r\nc.	Bulu rontok berlebihan\r\nd.	Umumnya gatal pada tubuh kucing\r\ne.	Terdapat kerak didaerah tubuhya\r\nf.	Terdapat bintik-bintik botak\r\ng.	Muncul lesi pada permukaan kulit. Biasanya mulai muncul diujung telinga\r\ndan telapak tangan\r\nJika gejala tersebut terjadi pada kucing anda, anda dapat melakukan pengobatan alternatif pertama yaitu Terapi luar dengan mengoleskan obat jamur yang mengandung sulfur/salep scabiad. Jika gejala semakin berlanjut, sebaiknya anda menghubungi dokter hewan dimana nantinya dokter akan memberikan obat pembasmi kutu dalam bentuk suntikan atau tetesan dikulit tengkuk kepala.\r\n\r\n5.	Eosinophilic Granuloma\r\nPenyakit Eosinophilic Granuloma merupakan penyakit yang disebabkan adanya massa atau nodular lesi yang mengandung eosinofil dan biasanya ditemukan di bagian belakang paha, di wajah, atau di mulut. Beberapa gejala penyakit ini yang dialami oleh kucing adalah sebagai berikut.\r\na.	Kucing menggaruk-garuk badan berlebihan\r\nb.	Kulit terlihat kemerahan\r\nc.	Terlihat luka yang basah dibelakang leher/paha dalam\r\nd.	Mulut atau dagu bengkak (edema)seperti bisul/sariawan\r\nJika kucing anda mengalami gejala diatas, anda dapat menerapkan langkah pengobatan antara lain bersihkan dahulu luka yang terbentuk di tubuh kucing, oleskan dengan Virgin Coconut Oil (VCO)/Iodine/Betadine. Jika gejala terus berlanjut,  periksakan hewan Anda ke dokter. Dokter akan merekomendasikan untuk cek darah.\r\n\r\nItu tadi 5 penyakit kulit pada kucing beserta gejalanya. Masih terdapat beberapa penyakit kulit yang tidak disebutkan di artikel ini. Kesimpulannya, jika kucing anda mengalami gejala yang menghawatirkan, anda harus segera membawanya ke dokter hewan untuk pengobatan yang tepat.\r\n', 'Putri, A. S. (2016). PENERAPAN METODE INFERENSI FORWARD CHAINING DALAM MENDIAGNOSA PENYAKIT KULIT PA');

